import React from "react";

class WelcomePage extends React.Component {

    disconnect(){
        localStorage.removeItem("token");
        window.location.reload();
    }

    render() {

        return <div>
            <p>Connected !</p>

            <button onClick={() => this.disconnect()}>Logout</button>
        </div>
    }
}

export default WelcomePage;
